package main

import "fmt"

func find(a []int, v, n int) int {
	count := 0
	for i := 0;i < len(a);i++ {
		if a[i] == v {
			count++
			if count == n {
				return i
			}
		}
	}
	return -1
}

func threeEqualParts(A []int) []int {
	aLen := len(A)
	if aLen < 3 {
		return []int{-1,-1}
	}
	B := make([]byte, aLen)
	num := 0
	for i := 0;i < aLen;i++ {
		num += A[i]
		B[i] = byte(A[i]) + '0'
 	}
 	if num == 0 {
 		return []int{0,2}
	}
 	if num % 3 != 0 || num < 3 {
 		return []int{-1,-1}
	}
	num /= 3
	var a1, a2, a3, a4, a5, a6 int
	a1 = find(A, 1, 1)
	a2 = a1 + find(A[a1:], 1, num)
	a3 = a2 + find(A[a2+1:], 1, 1) + 1
	a4 = a3 + find(A[a3:], 1, num)
	a5 = a4 + find(A[a4+1:], 1, 1) + 1
	a6 = a5 + find(A[a5:], 1, num)
	space := len(A) - a6 - 1
	if a2 + space < a3 && a4 + space < a5 && compare(A[a1:a2+1], A[a3:a4+1], A[a5:a6+1]) {
		return []int{a2+space,a4+space+1}
	}

	return []int{-1,-1}
}

func compare(a, b, c []int) bool {
	if len(a) != len(b) || len(b) != len(c) {
		return false
	}
	for i := 0;i < len(a);i++ {
		if a[i] != b[i] || b[i] != c[i] {
			return false
		}
	}
	return true
}

